  \"Zooplankton, chemical and other data from bottle and net cast from BOCAS DE CENIZA
  from the SE Pacific (limit-140) by the Inter-American Tropical Tuna Commission from
  21 May 1965 to 04 June 1965 (NODC Accession 9700119)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:54.804378\",\n\t\"name\": \"zooplankton-chemical-and-other-data-from-bottle-and-net-cast-from-bocas-de-ceniza-from-the-a724b\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Zooplankton, chemical and other data were
  collected from bottle and net cast from BOCAS DE CENIZA from the SE Pacific (limit-140).
  Data were collected by the Inter-American Tropical Tuna Commission from 21 May 1965
  to 04 June 1965. Zooplankton data include displaced volume and taxonomic name. Chemical
  data include water temperature, salinity, oxygen, phosphate, silicate, nitrite,
  chlorophyll a, phaeopigments, and nitrate. Other data include air temperature, relative
  humidity, barometric pressure, cloud amount, cloud type, wind speed, wind direction,
  and water transparency. Data are in a comma separated value (.csv) format. Additional
  funding for digitizing historic data were provided by the Global Ocean Data Archaeology
  and Rescue (GODAR) project.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
